export const Calculator = () => {
  return <></>;
};
const Challenge5 = () => {
  const a = 10;
  const b = 12;
  return (
    <>
      <h1>Calculator</h1>
      <p>Sum of two number is {a + b}</p>
      <p>Sub of two number is {a - b}</p>
      <p>Mul of two number is {a * b}</p>
      <p>Div of two number is {(a / b).toFixed(2)}</p>
    </>
  );
};

export default Challenge5;
